import collections
import itertools


class Solution:
    def checkInclusion(self, s1: str, s2: str) -> bool:
        print(s1, s2)
        print("---")
        return slidingwindow(s1, s2)


def bruteforce(s1, s2):
    for p in itertools.permutations(s1):
        if "".join(p) in s2:
            return True

    return False


def slidingwindow(s1, s2):
    if len(s2) < len(s1):
        return False

    s1count = [0] * 26
    s2count = [0] * 26

    for i in range(len(s1)):
        s1count[char_index(s1[i])] += 1
        s2count[char_index(s2[i])] += 1

    matches = 0
    for i in range(26):
        if s1count[i] == s2count[i]:
            matches += 1

    left = 0
    for right in range(len(s1), len(s2)):
        if matches == 26:
            return True

        idx = char_index(s2[right])
        s2count[idx] += 1
        if s1count[idx] == s2count[idx]:
            matches += 1
        elif s1count[idx] + 1 == s2count[idx]:
            matches -= 1

        idx = char_index(s2[left])
        s2count[idx] -= 1
        if s1count[idx] == s2count[idx]:
            matches += 1
        elif s1count[idx] - 1 == s2count[idx]:
            matches -= 1

        left += 1

    return matches == 26


def char_index(c):
    return ord(c) - 97


def slidingwindow_with_counters(s1, s2):
    if len(s2) < len(s1):
        return False

    s1_count = collections.Counter(s1)
    wsize = len(s1)

    for i in range(len(s2)):
        window = s2[i : i + wsize]

        # is the window an anagram of s1?
        if s1_count == collections.Counter(window):
            return True

    return False


